import React from 'react'
import './NavBar.css'
import rolgusIcon from '../images/icon.png'


class NavBar extends React.Component {
    render() {
        return (
            <div id="navbar">
                <img src={rolgusIcon } alt="Rolgus Minecraft face"/>
                <h1>Rolgus</h1>
                <i><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" style="fill: rgba(0, 0, 0, 1);transform: ;msFilter:;"><path d="M4 6h16v2H4zm0 5h16v2H4zm0 5h16v2H4z"></path></svg></i>
            </div>
        )
    }
}


export default NavBar;
